import React, { useState, useEffect } from 'react';
import SessionPage from './SessionPage';

const App = () => {
  const [documentUrl, setDocumentUrl] = useState('');
  const [sessionId, setSessionId] = useState(null);

  useEffect(() => {
    // Replace this with your actual logic to fetch document URL and session ID
    const fetchSessionData = async () => {
      const response = await fetch('/api/session-data');  // Your API endpoint
      const data = await response.json();
      setDocumentUrl(data.documentUrl);
      setSessionId(data.sessionId);
    };

    fetchSessionData();
  }, []);

  if (!documentUrl || !sessionId) {
    return <div>Loading...</div>;
  }

  return (
    <SessionPage documentUrl={documentUrl} sessionId={sessionId} />
  );
};

export default App;
